description:
Snowy the Bear is opening his own eatery to win the annual restaurant contest! Seat customers, take orders, serve food, collect cash and clear tables. Earn money to keep the restaurant open and upgrade to better and bigger locations. Match colors and chain actions to earn better tips. Pay special attention to VIPs and impatient drivers. Oh yeah, don't forget to entertain your guests with a good song! Help Snowy and Browny delight their customers in this fun restaurant themed Time Management game!
